import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
// import angelImage from '../assets/angel.png'; // Eğer melek resmi assets klasöründeyse bu şekilde import edin

const symbols = ['Σ', 'π', '∞', '∆', 'Ω', '√'];

function IntroAnimation() {
  const [showSymbols, setShowSymbols] = useState(true);
  // Statik URL yolunu kullanıyoruz, dosyayı public klasörüne koymalısınız
  // const [audio] = useState(new Audio('/assets/mystical-background.mp3'));

  useEffect(() => {
    const timer = setTimeout(() => {
      setShowSymbols(false);
    }, 6000); // Animasyon süresini biraz uzattım

    return () => clearTimeout(timer);
  }, []);

  // Müzik için önce Audio öğesinin yüklenip yüklenmediğini kontrol edelim
  // useEffect(() => {
  //   // Müzik ayarları
  //   if (audio) {
  //     audio.volume = 0.2; // Ses seviyesi
  //     audio.loop = true; // Sürekli çalma
      
  //     // Kullanıcı etkileşimi sonrası müziği başlat
  //     const startMusic = () => {
  //       audio.play().catch(error => console.log('Müzik başlatılamadı:', error));
  //       document.removeEventListener('click', startMusic);
  //     };

  //     document.addEventListener('click', startMusic);

  //     return () => {
  //       audio.pause();
  //       audio.currentTime = 0;
  //       document.removeEventListener('click', startMusic);
  //     };
  //   }
  // }, [audio]);

  return (
    <AnimatePresence>
      {showSymbols && (
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          exit={{ opacity: 0 }}
          className="fixed inset-0 flex items-center justify-center bg-midnight-default z-50"
        >
          <div className="relative w-full h-full flex items-center justify-center overflow-hidden">
            {/* Yıldızlı arka plan */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 0.7 }}
              transition={{ duration: 2 }}
              className="absolute inset-0 bg-[#0A0B1A] overflow-hidden"
            >
              {/* Parlayan yıldızlar */}
              {[...Array(20)].map((_, i) => (
                <motion.div
                  key={i}
                  initial={{ opacity: 0 }}
                  animate={{ opacity: [0.4, 1, 0.4] }}
                  transition={{
                    duration: 3 + Math.random() * 2,
                    repeat: Infinity,
                    delay: Math.random() * 3
                  }}
                  className="absolute w-1 h-1 bg-gold-light rounded-full"
                  style={{
                    left: `${Math.random() * 100}%`,
                    top: `${Math.random() * 100}%`,
                    boxShadow: '0 0 4px 1px rgba(255, 215, 0, 0.6)'
                  }}
                />
              ))}
            </motion.div>

            {/* Melek görseli */}
            <motion.div
              initial={{ opacity: 0, y: 10 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 2, delay: 0.5 }}
              className="relative z-10 max-w-sm mx-auto"
            >
              <img
                src="/assets/golden-angel.jpg"
                alt="Melek"
                className="max-h-[70vh] object-contain rounded-lg shadow-lg shadow-gold-default/20"
              />
            </motion.div>

            {/* Işık efekti */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: [0, 0.5, 0] }}
              transition={{
                duration: 4,
                repeat: Infinity,
                ease: "easeInOut"
              }}
              className="absolute inset-0 bg-gradient-radial from-gold-default/30 via-transparent to-transparent z-0"
              style={{
                backgroundSize: '120% 120%',
                backgroundPosition: 'center',
              }}
            />

            {/* Semboller artık meleğin etrafında dönüyor */}
            {symbols.map((symbol, index) => (
              <motion.div
                key={symbol}
                initial={{ scale: 0, rotate: 0, opacity: 0 }}
                animate={{
                  scale: 1,
                  rotate: 360,
                  opacity: 0.8,
                  x: Math.cos(index * (2 * Math.PI / symbols.length)) * 200,
                  y: Math.sin(index * (2 * Math.PI / symbols.length)) * 200
                }}
                transition={{
                  duration: 2,
                  delay: 1 + (index * 0.2),
                  ease: "easeOut"
                }}
                className="absolute z-20"
              >
                <span className="text-4xl font-cinzel text-gold-light">{symbol}</span>
              </motion.div>
            ))}

            {/* Başlık ve Hoşgeldiniz mesajı */}
            <motion.div
              className="absolute bottom-10 left-1/2 transform -translate-x-1/2 flex flex-col items-center z-20"
            >
              <motion.h1
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 1.5, duration: 1 }}
                className="text-3xl md:text-4xl font-cinzel text-gold-default whitespace-nowrap bg-midnight-default/50 px-6 py-2 rounded-lg"
              >
                Nomen Est Omen
              </motion.h1>

              <motion.p
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay: 2, duration: 1 }}
                className="mt-4 text-xl font-cinzel text-gold-light bg-midnight-default/50 px-4 py-1 rounded-lg"
              >
                Hoşgeldiniz
              </motion.p>
            </motion.div>
          </div>
        </motion.div>
      )}
    </AnimatePresence>
  );
}

export default IntroAnimation;
